import React from "react";
import "./App.css";
import Navbar from "./components/navbar";
import Main from "./components/image-area";
import image from "../public/logo192.png";

function App() {
  return (
    <div className="App">
      <div styles={{ backgroundImage: `url( ${image} )` }}>
        <Navbar></Navbar>
        <Main></Main>
      </div>
    </div>
  );
}

export default App;
